import React, { FC } from "react";
import styled from "styled-components";

interface SimpleInputProps {
    title: string
    placeholder: string
    changed(event: React.ChangeEvent<HTMLInputElement>): void
}

// const SimpleInputStyle = styled.input<SimpleInputProps>`
//   margin: 5px;
//   padding: 5px;
//   border: 1px solid black;
//   background-color: lightgray;
//   border-radius: 5px;
// `;

export const SimpleInput: FC<SimpleInputProps> = (props: SimpleInputProps) => (
    <input
        style={{margin: '5px', padding: '5px', border: '1px solid black', backgroundColor: 'lightgray', borderRadius: '5px'}}
        placeholder={props.placeholder}
        onChange={(event) => {
            event.preventDefault()
            props.changed(event)
        }}
    />
)
